import { WishlistProvider } from './WishlistContext';
import { CartProvider } from './CartProvider';


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <CartProvider>
   <WishlistProvider>
    <LivePageContext>
    <App />
    </LivePageContext>
    </WishlistProvider>
    </CartProvider>
  </React.StrictMode>
);

